Accounts_CustomFields_Description:
Jābūt derīgam JSON, kur taustiņi ir lauku nosaukumi, kuros ir lauku iestatījumu vārdnīca. Piemērs: <br/><code>{
"loma": {
"tips": "izvēlēties"
"noklusējumavērtba": "students"
"iespējas": ["skolotājs", "students"],
"nepieciešams": patiess
"pārveidotierakstalauku": {
"masīvs": patiess
"lauks": "lomas"
}
},
"twitter": {
"tips": "teksts",
"nepieciešams": patiess
"mingarums": 2,
"maksgarums": 10
}
}</code>

Custom_Translations_Description:
Jābūt derīgam JSON, kur taustiņi ir valodas, kurās ir taustiņu vārdnīca un tulkojumi.  Piemērs:<br/><code>{
 "en": {
  "Kanāli": "Istabas"
 },
 "pt": {
  "Kanāli": "Salas"
 }
}</code>
